    <g transform="matrix(1,0,0,1,1081.45,1439.88)" ed:parentid="205" ed:height="293.1176470588235" ed:width="714.0847058823529" id="211">
        <path stroke="#e75083" stroke-width="2" stroke-linejoin="round" d="M73.3,0L640.8,0L714.1,146.6L640.8,293.1L73.3,293.1L0,146.6L73.3,0z" fill="none"/>
        <text class="st2">
            <tspan style="white-space:pre" textLength="14" x="106" y="14.276">/**</tspan>
            <tspan style="white-space:pre" textLength="221" x="106" y="29.335"> * author: B00125142 Violet Concordia</tspan>
            <tspan style="white-space:pre" textLength="388" x="106" y="44.394"> * Brute force approach to find the highest divider without remainder</tspan>
            <tspan style="white-space:pre" textLength="12" x="106" y="59.453"> * </tspan>
            <tspan style="white-space:pre" textLength="215" x="106" y="74.512"> * @param input the number to divide</tspan>
            <tspan style="white-space:pre" textLength="236" x="106" y="89.571"> * @returns the divider without remainder</tspan>
            <tspan style="white-space:pre" textLength="12" x="106" y="104.629"> */</tspan>
            <tspan style="white-space:pre" textLength="486" x="106" y="119.688">export function findBiggestDivider(input: number, max: number = MAX_INT): number</tspan>
            <tspan style="white-space:pre" textLength="4" x="106" y="134.747">{</tspan>
            <tspan style="white-space:pre" textLength="482" x="106" y="149.806">    //Decrement loop `max` until either a no remainder result is found, or it reaches 0.</tspan>
            <tspan style="white-space:pre" textLength="132" x="106" y="164.865">    for(; max > 0; --max)</tspan>
            <tspan style="white-space:pre" textLength="19" x="106" y="179.924">    {</tspan>
            <tspan style="white-space:pre" textLength="156" x="106" y="194.982">        if(input/max % 1 == 0)</tspan>
            <tspan style="white-space:pre" textLength="79" x="106" y="210.041">            break;</tspan>
            <tspan style="white-space:pre" textLength="19" x="106" y="225.1">    }</tspan>
            <tspan style="white-space:pre" textLength="478" x="106" y="240.159">    //Return max, which is hopefully the highest number without a remainder. (Worst </tspan>
            <tspan style="white-space:pre" textLength="122" x="106" y="255.218">case scenario, it is 0)</tspan>
            <tspan style="white-space:pre" textLength="80" x="106" y="270.276">    return max;</tspan>
            <tspan style="white-space:pre" textLength="4" x="106" y="285.335">}</tspan>
        </text>
    </g>
    <g transform="matrix(1,0,0,1,917.31,1968.32)" ed:parentid="203" ed:height="22.05882352941177" ed:width="135.6282352941176" id="213">
        <path stroke="#e75083" stroke-width="2" stroke-linejoin="round" d="M5.5,0L130.1,0L135.6,11L130.1,22.1L5.5,22.1L0,11L5.5,0z" fill="none"/>
        <text class="st2">
            <tspan style="white-space:pre" textLength="111" x="9" y="14.276">findBiggestDividers</tspan>
        </text>
    </g>
    <g transform="matrix(1,0,0,1,1088.04,1757.5)" ed:parentid="213" ed:height="443.7058823529412" ed:width="822.5082352941176" id="215">
        <path stroke="#e75083" stroke-width="2" stroke-linejoin="round" d="M110.9,0L711.6,0L822.5,221.9L711.6,443.7L110.9,443.7L0,221.9L110.9,0z" fill="none"/>
        <text class="st2">
            <tspan style="white-space:pre" textLength="14" x="161" y="14.276">/**</tspan>
            <tspan style="white-space:pre" textLength="221" x="161" y="29.335"> * author: B00125142 Violet Concordia</tspan>
            <tspan style="white-space:pre" textLength="479" x="161" y="44.394"> * Appends every highest no remainder divider to an array, until the input number is </tspan>
            <tspan style="white-space:pre" textLength="134" x="161" y="59.453">below the `max` value. </tspan>
            <tspan style="white-space:pre" textLength="12" x="161" y="74.512"> * </tspan>
            <tspan style="white-space:pre" textLength="223" x="161" y="89.571"> * @param input The number to divide.</tspan>
            <tspan style="white-space:pre" textLength="176" x="161" y="104.629"> * @returns The dividers array.</tspan>
            <tspan style="white-space:pre" textLength="12" x="161" y="119.688"> */</tspan>
            <tspan style="white-space:pre" textLength="449" x="161" y="134.747">export function findBiggestDividers(input: number, max: number = MAX_INT): </tspan>
            <tspan style="white-space:pre" textLength="51" x="161" y="149.806">number[]</tspan>
            <tspan style="white-space:pre" textLength="4" x="161" y="164.865">{</tspan>
            <tspan style="white-space:pre" textLength="193" x="161" y="179.924">    //Init array that will be returned.</tspan>
            <tspan style="white-space:pre" textLength="119" x="161" y="194.982">    const dividers = [];</tspan>
            <tspan style="white-space:pre" textLength="243" x="161" y="210.041">    //While input is higher than max number</tspan>
            <tspan style="white-space:pre" textLength="128" x="161" y="225.1">    while(input >= max)</tspan>
            <tspan style="white-space:pre" textLength="19" x="161" y="240.159">    {</tspan>
            <tspan style="white-space:pre" textLength="232" x="161" y="255.218">        //Find biggest no remainder divider.</tspan>
            <tspan style="white-space:pre" textLength="337" x="161" y="270.276">        const biggestDivider = findBiggestDivider(input, max);</tspan>
            <tspan style="white-space:pre" textLength="162" x="161" y="285.335">        //Push the found value.</tspan>
            <tspan style="white-space:pre" textLength="200" x="161" y="300.394">        dividers.push(biggestDivider);</tspan>
            <tspan style="white-space:pre" textLength="431" x="161" y="315.453">        // console.log(`${input} / ${biggestDivider} = ${input / biggestDivider}`);</tspan>
            <tspan style="white-space:pre" textLength="164" x="161" y="330.512">        //Divide by found value.</tspan>
            <tspan style="white-space:pre" textLength="197" x="161" y="345.571">        input = input / biggestDivider;</tspan>
            <tspan style="white-space:pre" textLength="19" x="161" y="360.629">    }</tspan>
            <tspan style="white-space:pre" textLength="224" x="161" y="375.688">    //Push the remainder to result in a 1.</tspan>
            <tspan style="white-space:pre" textLength="131" x="161" y="390.747">    dividers.push(input);</tspan>
            <tspan style="white-space:pre" textLength="134" x="161" y="405.806">    //Return the dividers.</tspan>
            <tspan style="white-space:pre" textLength="100" x="161" y="420.865">    return dividers;</tspan>
            <tspan style="white-space:pre" textLength="4" x="161" y="435.924">}</tspan>
        </text>
    </g>
    <g transform="matrix(1,0,0,1,802.2,1271.38)" ed:parentid="197" ed:height="22.05882352941177" ed:width="82.20176470588237" id="217">

        <path stroke="#e75083" stroke-width="2" stroke-linejoin="round" d="M62,0L483.3,0L545.3,124L483.3,247.9L62,247.9L0,124L62,0z" fill="none"/>
        <text class="st2">
            <tspan style="white-space:pre" textLength="129" x="90" y="14.276">export const BITS = 8;</tspan>
            <tspan style="white-space:pre" textLength="257" x="90" y="29.335">export const MAX_INT = Math.pow(2, BITS);</tspan>
            <tspan style="white-space:pre" textLength="138" x="90" y="59.453">export const K = 1_000;</tspan>
            <tspan style="white-space:pre" textLength="160" x="90" y="74.512">export const KK = 1_000*K;</tspan>
            <tspan style="white-space:pre" textLength="166" x="90" y="89.571">export const FREQ = 33*KK;</tspan>
            <tspan style="white-space:pre" textLength="197" x="90" y="104.629">export const TOGGLE_FREQ = 2;</tspan>
            <tspan style="white-space:pre" textLength="254" x="90" y="119.688">export const TOGGLE_CYCLES = 2*FREQ;</tspan>
            <tspan style="white-space:pre" textLength="204" x="90" y="149.806">export const DUTY_CYCLE = 0.75;</tspan>
            <tspan style="white-space:pre" textLength="354" x="90" y="179.924">export const ON_TIME_S = TOGGLE_FREQ*DUTY_CYCLE;</tspan>
            <tspan style="white-space:pre" textLength="286" x="90" y="194.982">export const ON_CYCLES = ON_TIME_S*FREQ;</tspan>
            <tspan style="white-space:pre" textLength="355" x="90" y="225.1">export const OFF_TIME_S = TOGGLE_FREQ - ON_TIME_S;</tspan>
            <tspan style="white-space:pre" textLength="299" x="90" y="240.159">export const OFF_CYCLES = OFF_TIME_S*FREQ;</tspan>
        </text>
    </g>
    <g transform="matrix(1,0,0,1,802.2,2740.17)" ed:parentid="197" ed:height="22.05882352941177" ed:width="66.83411764705883" id="221">

        <text class="st2">
            <tspan style="white-space:pre" textLength="236" x="63" y="14.276">console.log(`1s = ${FREQ} instructions`);</tspan>
            <tspan style="white-space:pre" textLength="405" x="63" y="29.335">console.log(`On for ${ON_TIME_S}s, Off for ${OFF_TIME_S}s, total: $</tspan>

        <path stroke="#e75083" stroke-width="2" stroke-linejoin="round" d="M54.5,0L532.8,0L587.3,108.9L532.8,217.8L54.5,217.8L0,108.9L54.5,0z" fill="none"/>
        <text class="st2">
            <tspan style="white-space:pre" textLength="114" x="79" y="14.276">Debugger attached.</tspan>

        <text class="st2">
            <tspan style="white-space:pre" textLength="452" x="9" y="14.276">If we want to loop for a single second, we would need to count up to 33 Million.</tspan>

    </g>

        <text class="st2">
            <tspan style="white-space:pre" textLength="492" x="14" y="14.276">To circumvent this, nested loops will be utilised, which essentially provide us a way to </tspan>
            <tspan style="white-space:pre" textLength="335" x="14" y="29.335">keep track of up to 256^n per loop, n being the loop count.</tspan>
        </text>
    </g>

        </text>
